import React from "react";
import { motion } from "framer-motion";
import {
  IconBrandCss3,
  IconBrandGithub,
  IconBrandHtml5,
  IconBrandJavascript,
  IconExternalLink,
  IconBrandReact,
  IconBrandNodejs,
  IconBrandBootstrap,
  IconBrandFirebase,
} from "@tabler/icons-react";
import projectsData from "../../../utils/projects";

function MyProjects() {
  const renderTechStackIcons = (techStack) => {
    const skillIcons = {
      HTML5: <IconBrandHtml5 size={24} strokeWidth={2} />,
      CSS3: <IconBrandCss3 size={24} strokeWidth={2} />,
      JavaScript: <IconBrandJavascript size={24} strokeWidth={2} />,
      "React.js": <IconBrandReact size={24} strokeWidth={2} />,
      "Node.js": <IconBrandNodejs size={24} strokeWidth={2} />,
      Bootstrap: <IconBrandBootstrap size={24} strokeWidth={2} />,
      Firebase: <IconBrandFirebase size={24} strokeWidth={2} />,
    };

    return techStack.map((tech, index) => (
      <span key={index} className="icon">
        {skillIcons[tech]}
      </span>
    ));
  };
  return (
    <>
      <motion.div
        initial={{ opacity: 0, y: -100 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5, delay: 0.3 }}
        viewport={{ once: true }}
      >
        <div className="projects-container">
          {" "}
          <h2>My Projects</h2>
          {projectsData.map((project, index) => (
            <div className="project-card" key={index}>
              <div className="project-content">
                {project.image ? (
                  <img
                    src={project.image}
                    alt={project.title}
                    className="project-img"
                  />
                ) : (
                  <img
                    src="/images/placeholder.png"
                    className="project-img"
                    alt="Placeholder"
                  />
                )}
                <h4 className="project-title">{project.title}</h4>
                <div className="project-made-with">
                  {renderTechStackIcons(project.techStack)}
                </div>
                <div>{project.academicProject ? "Academic Project" : ""}</div>
                <div className="project-description">
                  <p>{project.description}</p>
                </div>
                <div className="project-footer">
                  <div className="project-social-links">
                    <a href={project.githubLink}>
                      <IconBrandGithub />
                    </a>
                  </div>
                  <div className="project-external-link">
                    <a href={project.externalLink}>
                      <IconExternalLink />
                    </a>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </motion.div>
    </>
  );
}

export default MyProjects;
